import React, {Component} from 'react';
class Footer extends Component{
  render(){
    return(
      <div>
         <div class="panel panel-default">
               <div class="panel-body">
                     Panel content
               </div>
               <div class="panel-footer">
                     Panel footer
                 </div>
         </div> 
      </div>
    )
  }

}

export default Footer;
